n produce messages."}, "max_block_ms": {"type": "string", "title": "Max Block ms", "examples": [60000], "description": "The configuration controls how long the KafkaProducer's send(), partitionsFor(), initTransactions(), sendOffsetsToTransaction(), commitTransaction() and abortTransaction() methods will block."}, "buffer_memory": {"type": "string", "title": "Buffer Memory", "examples": 33554432, "description": "The total bytes of memory the producer can use to buffer records waiting to be sent to the server."}, "sync_producer": {"type": "boolean", "title": "Sync Producer", "default": false, "description": "Wait synchronously until the record has been sent to Kafka."}, "topic_pattern": {"type": "string", "title": "Topic Pattern", "examples": ["sample.topic", "{namespace}.{stream}.sample"], "description": "Topic pattern in which the records will be sent. You can use patterns like '{namespace}' and/or '{stream}' to send the message to a specific topic based on these values. Notice that the topic name will be transformed to a standard naming convention."}, "compression_type": {"enum": ["none", "gzip", "snappy", "lz4", "zstd"], "type": "string", "title": "Compression Type", "default": "none", "description": "The compression type for all data generated by the producer."}, "max_request_size": {"type": "integer", "title": "Max Request Size", "examples": [1048576], "description": "The maximum size of a request in bytes."}, "bootstrap_servers": {"type": "string", "title": "Bootstrap Servers", "examples": ["kafka-broker1:9092,kafka-broker2:9092"], "description": "A list of host/port pairs to use for establishing the initial connection to the Kafka cluster. The client will make use of all servers irrespective of which servers are specified here for bootstrapping&mdash;this list only impacts the initial hosts used to discover the full set of servers. This list should be in the form <code>host1:port1,host2:port2,...</code>. Since these servers are just used for the initial connection to discover the full cluster membership (which may change dynamically), this list need not contain the full set of servers (you may want more than one, though, in case a server is down)."}, "client_dns_lookup": {"enum": ["default", "use_all_dns_ips", "resolve_canonical_bootstrap_servers_only", "use_all_dns_ips"], "type": "string", "title": "Client DNS Lookup", "default": "use_all_dns_ips", "description": "Controls how the client uses DNS lookups. If set to use_all_dns_ips, connect to each returned IP address in sequence until a successful connection is established. After a disconnection, the next IP is used. Once all IPs have been used once, the client resolves the IP(s) from the hostname again. If set to resolve_canonical_bootstrap_servers_only, resolve each bootstrap address into a list of canonical names. After the bootstrap phase, this behaves the same as use_all_dns_ips. If set to default (deprecated), attempt to connect to the first IP address returned by the lookup, even if the lookup returns multiple IP addresses."}, "send_buffer_bytes": {"type": "integer", "title": "Send Buffer bytes", "examples": [131072], "description": "The size of the TCP send buffer (SO_SNDBUF) to use when sending data. If the value is -1, the OS default will be used."}, "enable_idempotence": {"type": "boolean", "title": "Enable Idempotence", "default": false, "description": "When set to 'true', the producer will ensure that exactly one copy of each message is written in the stream. If 'false', producer retries due to broker failures, etc., may write duplicates of the retried message in the stream."}, "request_timeout_ms": {"type": "integer", "title": "Request Timeout", "examples": [30000], "description": "The configuration controls the maximum amount of time the client will wait for the response of a request. If the response is not received before the timeout elapses the client will resend the request if necessary or fail the request if retries are exhausted."}, "delivery_timeout